pragma solidity ^0.8.15;

import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";

// IngToken  -> Tx , CA
// IngToken   IngToken CA  EthSwap 
// EthSwap  -> Tx
    // IngToken CA    
    // EthSwap   IngToken  
    // CA.balanceOf() : call 
    // CA.transfer() : send 
//      CA 

contract EthSwap {

    // CA    
    ERC20 public token;  // ERC20     : import   + ERC20.sol   ERC20    
    //   

    // ERC20  CA  .
    constructor(ERC20 _token) {
        token = _token;
    }

    // EOA -> EthSwap (Contract) -> getToken() -> IngToken CA 
    function getToken() public view returns (address) {
        // token ERC20   address  
        return address(token); // IngToken CA
    }

    // EOA -> EthSwap -> balanceOf()
    // balanceOf() IngToken   
    // EthSwap  IngToken       
    function getSwapBalance() public view returns (uint) {
        return token.balanceOf(msg.sender);
    }

    function getThis() public view returns (address) {
        return address(this); 
        //  this    (this == EthSwap)
        // address(this) == EthSwap CA
    }

    function getMsgSender() public view returns (address) {
        return msg.sender;
        // msg.sender == EthSwap  
        /*
            txObject = {
                from: from   msg.sender 
                to:
                value:
                data:
            }
        */
    }

    // IngToken owner
    // IngToken CA
    // IngToken msg.sender

    // EthSwap CA
    // EthSwap msg.sender

    // EthSwap        .

}
